import React,{useState} from 'react';
import {BrowserRouter,Route, Routes} from 'react-router-dom';
import './App.css';
import Header from './Header'
import AddContact from './AddContact'
import ContactList from './ContactList'

function App(){
  const [Lists,setLists] = useState([
    {
      "name" : "rajesh",
      "email" : "rajesh@gmail.com"
    },
    {
      "name" : "guru",
      "email" : "guru@gmail.com"
    }
  ]);
  const Fun = (OBJ) => {
    setLists([...Lists,OBJ]);
    console.log(Lists);
  };
  return (
    <div>
      <BrowserRouter>
        <Header />
        {/* <Routes> */}
          <Route path="/add" element={<AddContact Fun = {Fun}  />} />
          <Route path="/" element={<ContactList Contacts = {Lists} />} />
        {/* </Routes> */}
      </BrowserRouter>
    </div>
  );
}

export default App;
